function changeUptimeToReadable(time) {
  var timeStr = '';
  var t = parseInt(time, 10);
  var days = Math.floor(t / (24 * 3600));
  var hours = Math.floor((t - days * 24 * 3600) / 3600);
  var minutes = Math.floor((t - days * 24 * 3600 - hours * 3600) / 60);
  var seconds = Math.floor((t - days * 24 * 3600 - hours * 3600 - minutes * 60) % 60);
  if (days > 0) {
    timeStr = days + 'd ' + hours + 'h ' + minutes + 'm ' + seconds + 's ';
  } else if (hours > 0) {
    timeStr = hours + 'h ' + minutes + 'm ' + seconds + 's ';
  } else if (minutes > 0) {
    timeStr = minutes + 'm ' + seconds + 's ';
  } else {
    timeStr = seconds + 's';
  }
  return timeStr;
}

